import React from "react";
import "./Portfolio.css";
import { img1 } from "../../logos/Rectangle 22.png";
import { img2 } from "../../logos/Rectangle 20.png";
import { img3 } from "../../logos/Rectangle 17.png";
import { img4 } from "../../logos/image 5.png";
import { img5 } from "../../logos/Rectangle 21.png";
import { img6 } from "../../logos/Rectangle 22.png";

export const Portfolio = () => {
  return (
    <div className='wrapper'>
      <div className='section'>
        <h2 className='section_title'>Portfolio</h2>
        <p className='info_text'>Some of the projects we have worked on</p>
        <div className='portfolio_navbar'>
          <span>All</span>
          <span>Branding</span>
          <span>Packaging Design</span>
          <span>Logo Design</span>
          <span>Naming</span>
          <span>Ads & Media</span>
          <span>UI/UX Design</span>
        </div>
        <div className='section_wrapper'>
          <img src={img1} alt='' />
          <img src={img2} alt='' />
          <img src={img3} alt='' />
          <img src={img4} alt='' />
          <img src={img5} alt='' />
          <img src={img6} alt='' />
          <img src={img7} alt='' />
        </div>
      </div>
    </div>
  );
};
